@lonespiderlily The shade would move closer...as they took the knife from the floor..taking the blood from it...and soon...a chant would begin

*Oh queen of old...the sacrifice  has been made...now!...be...reborn!!*

The shade stabbed the knife againt the crystal....as it shattered-

Le critican a @RudyReyez que no siguió el reto por no tener parentesco pero a @mistaboo_ le dicen que es una de Las Más y es básicamente lo mismo.

No shade a ellas, lo hicieron muy bien pero ya ven como no son nada congruentes en el jurado.

@Lamasdraga #LaMasDraga3 #LaMasDraga
